!function(){new Vue({el:"body",data:{status:{isLoading:!0},count:0,data:[]},ready:function(){this.getData()},methods:{getData:function(){this.$http.get("../phpCtrl/getCount.php").then(function(t){if(1==t.json().result){var a=t.json().data;this.$set("data",a),this.status.isLoading=!1;for(key in a)this.count+=~~a[key].value}else location.href="./login.html"})}}})}();